import './chartExample.css';
// eslint-disable-next-line no-unused-vars
import Chart from "chart.js/auto";
import { Bar } from 'react-chartjs-2';

function Example() {
  return (
    <div>
      <Bar
        data={{
          labels: [
            'sfdasdsa',
            'dsacsa'

          ],
        }}
        height={400}
        width={600}
        options={{
          maintainAspectRatio: false,
        }}
      />
    </div>
  );
}

export default Example;
